/** @format */
import createReducer from "./createReducer";

export const initialState = {
  mainPost: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "민구",
      },
      content: "첫번째 게시글",
      Images: [],
      Comments: [],
    },
  ],
};

export default createReducer(initialState, {});
